<template>
    <div :class="{ 'alert': true, 'show': show }">
      <img src="data:image/gif;base64," class="gif"/>
      {{ message }}
    </div>
  </template>
    
  <script setup lang="ts">
  import { ref } from "vue";
  
  const show = ref(false);
  const message = ref("");
  
  const displayAlert = (msg: string) => {
    message.value = msg;
    show.value = true;
  };
  
  const closeAlert = () => {
    show.value = false;
  };

  defineExpose({ displayAlert,closeAlert });
  </script>
    
  <style scoped>
  .alert {
    position: fixed;
    top: -100%; /*  */
    left: 50%;
    right: 0;
    padding: 10px;
    background-color: white;
    color: black;
    text-align: center;
    width: 6%;
    height: 3%;
    border-radius: 10px;
    display: flex;
    justify-content: center; 
    align-items: center; 
    font-size: 17px;
    transition: top 0.3s ease; /*  transition  */
  }
  
  .show {
    top: 2%; /*  show  true  */
  }
  
  .icon {
    width: 20px; 
    height: auto; 
    margin-right: 10px; 
  }

  .gif{
    width: 19px; 
    height: auto; 
    margin-right: 10px; 
  }
  </style>
  